import React, { Component } from 'react';

class Navbar extends  Component{

   render(){   
       const { friends } = this.props;
       const friendsList = friends.map(friend=>{
        return(
           <div>
               <ul key={friends.id}>
                   <li >{friend.name}</li>
                   <li>{friend.interest}</li>
                   <li>{friend.age}</li>
               </ul>
           </div>
        )          
       })
    return(
        <div>
        {friendsList}
        </div>
    )      
   }
}

export default Navbar
